import React , {Component} from 'react';
import logo from '../log.svg';


class Homepage extends Component {


		render() {
			return(

				<div>

				<img src={logo} width="115" height="115" />

				<h3> TRAVLENDAR </h3>

				<button> Login </button>

				<button> Sign Up </button>

				<button> Social Login </button>


				</div>

				);
		}

}
export default Homepage;
